import { FunctionComponent ,useEffect} from "react";
import Navbar from "../components/navbar";
import { TweenMax, Power4, Elastic, Bounce } from 'gsap';

const SignUpPage: FunctionComponent = () => {
  useEffect(() => {
    // Store the animated element in a variable
    const animatedElement = document.querySelector('.animated-element');

    // Check if the element exists
    if (animatedElement) {
      // Set initial CSS properties (off-screen position)
      TweenMax.set(animatedElement, { x: '-100%', y: '-100%', opacity: 0, rotation: -180 });

      // Animate the element's entrance
      TweenMax.to(animatedElement, 2, {
        x: '0%',
        y: '0%',
        opacity: 1,
        rotation: 0,
        ease: Elastic.easeOut.config(1, 0.5),
        delay: 0.5, // Delay before the animation starts
      });

      // Add a bouncing effect
      TweenMax.to(animatedElement, 1, {
        y: '+=20',
        repeat: -1,
        yoyo: true,
        ease: Bounce.easeInOut,
      });

      // Add a pulsating effect
      TweenMax.to(animatedElement, 0.5, {
        scale: 1.2,
        repeat: -1,
        yoyo: true,
        ease: Power4.easeInOut,
      });
    }
  }, []);



  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-11xl text-white font-inter">
      <Navbar />
      <div className="absolute top-[218px] left-[169px] w-[1312px] h-[723px] text-9xl text-darkslategray-100 font-sora">
        <img
          className="absolute top-[0px] left-[592px] w-[720px] h-[628px] object-cover animated-element"
          alt=""
          src="/httpslottiefilescomanimationsloginwles6gkjqx@2x.png"
        />
        <b className="absolute top-[100px] left-[0px] text-21xl inline-block text-black w-[181px] h-[49px]">
          SIGNUP
        </b>
        <div className="absolute top-[411px] left-[0px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver" />
        <div className="absolute top-[200px] left-[0px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver" />
        <div className="absolute top-[301px] left-[0px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver" />
        <div className="absolute top-[650px] left-[0px] rounded-11xl bg-darkslategray-100 w-[181px] h-[73px]" />

        <div className="absolute top-[429px] left-[23px] font-light inline-block w-[397px] h-12">
          {" "}
          Enter password again
        </div>
        <div className="absolute top-[222px] left-[23px] font-light inline-block w-[397px] h-12">
          {" "}
          Enter your Email id
        </div>
        <div className="absolute top-[322px] left-[23px] font-light inline-block w-[397px] h-12">
          {" "}
          Enter password
          <img
          className="absolute h-[4.7%] w-[3.51%] top-[59.34%] right-[56.25%] bottom-[35.96%] left-[40.24%] max-w-full overflow-hidden max-h-full"
          alt=""
          src="/vector5.svg"
        />
        </div>
        <div className="absolute top-[521px] left-[0px] rounded-sm bg-white [backdrop-filter:blur(8px)] box-border w-[592px] h-[70px] border-[1px] border-solid border-silver" />
        <div className="absolute top-[539px] left-[23px] font-light inline-block w-[397px] h-12">
          {" "}
          Enter your name
        </div>
        <img
          className="absolute h-[4.7%] w-[3.51%] top-[44.12%] right-[56.25%] bottom-[51.18%] left-[40.24%] max-w-full overflow-hidden max-h-full"
          alt=""
          src="/vector5.svg"
        />
        <div className="absolute top-[667px] left-[35px] text-11xl font-light text-white inline-block w-[202px] h-10">
          Sign up
        </div>
      </div>
    </div>
  );
};

export default SignUpPage;
